{"title":"PiramideClientes","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "data": {
    "url": {"index": "demografia", "body": {"size": 7043}},
    "format": {"property": "hits.hits"}
  },
  "transform": [
    {"fold": ["_source.Age"], "as": ["k1", "edad"]},
    {"fold": ["_source.Gender"], "as": ["k2", "Genero"]}
  ],
  "hconcat": [
    {
      "transform": [{"filter": {"field": "Genero", "equal": "Female"}}],
      "title": "Female",
      "mark": "bar",
      "encoding": {
        "y": {"field": "edad", "axis": null, "sort": "descending"},
        "x": {
          "aggregate": "count",
          "field": "edad",
          "title": "Clientes",
          "sort": "descending"
        },
        "color": {"field": "Genero", "scale": {"range": ["#c0330a", "#1dac6d"]}}
      }
    },
    {
      "view": {"stroke": null},
      "mark": {"type": "text", "align": "center"},
      "encoding": {
        "y": {
          "field": "edad",
          "type": "ordinal",
          "axis": null,
          "sort": "descending"
        },
        "text": {"field": "edad", "type": "quantitative"},
        "color": {"value":"white"}
      }
    },
    {
      "transform": [{"filter": {"field": "Genero", "equal": "Male"}}],
      "title": "Male",
      "mark": "bar",
      "encoding": {
        "y": {
          "field": "edad",
          "title": null,
          "axis": null,
          "sort": "descending"
        },
        "x": {"aggregate": "count", "field": "edad", "title": "Clientes"},
        "color": {"field": "Genero", "legend": null}
      }
    }
  ]
}"}}
